import React, { Component } from 'react'
import { NavLink,Switch } from 'react-router-dom'
import { get } from '../../../../utils/axios'
import './index.css'

export default class Record extends Component {
    state={
        arr:[]
    }
    getall = async()=>{
        try{
            let res = await get('/api/getall')
            this.setState({arr:res.data.data})
        }catch(err){
            console.log("error",err)
     }
    }
    componentDidMount(){
        this.getall()
    }
    render() {
        return (
                <div className="showlink">
                    <NavLink to="/List/Record/ShowList">列表显示</NavLink>
                    <NavLink to="/List/Record/Showpic">图表显示</NavLink>
                    <Switch>
                    <Route path="/List/Record/ShowList" component={Record}></Route>
                    <Route path="/List/Record/Showpic" component={Showpic}></Route>
                    </Switch>
                    
                </div>        
        )
    }
}
